		"rdf:value": "My thinking about collaboration has been based on several close working relationships with innovative women writers, including Bergvall, Brossard, and Moure. I first collaborated with Bergvall in 1996 when, after seeing her stunning sound poetry performance at the   Assembling Alternatives Poetry Conference/Festival   at the University of New Hampshire, I invited her to spend a week at the University of Calgary as a visiting scholar. Most recently, our conversational text about Bergvalls collaborative performance piece Say Parsley appeared in the University of Pennsylvanias online journal Jacket2 in 2011. My collaborations with Moure also began in the 1990s and have continued. She contributed her essay The Anti-Anaesthetic to an issue of Open Letter that I edited, and an interview that Pauline Butling and I conducted with Moure appears in our collaborative book project Poets Talk. Moure, Bergvall, and Butling all participated in the 1997   Women and Texts conference   at the University of Leeds, an event that arose out of another collaboration, between myself, Lynette Hunter, and Marta Dvorak."
